import './style.scss';
import React, { Component } from 'react'

class Footer extends Component {
  render() {
    return (
      <footer className="t-footer">Marta Petrella 2019 - <small>GNU GENERAL PUBLIC LICENSE</small></footer>
    )
  }
}
export default Footer;
